import react from 'react'

function Passo(props) {



    return (
        <div>
            <label for="passoInput">Passo: {this.state.passo}</label>
            <input 
            id="passoInput" 
            type="number" 
            value={props.passo} 
            onChange={(e) => props.onPassoChange(+e.target.value)}></input>
        </div>
    )
}


export default Passo;
